@Chư Sê
- (huyện) Huyện miền núi ở phía nam tỉnh Gia Lai. Diện tích 1.217km2. Số dân 83.347 (1993), gồm các dân tộc: Giarai, êđê, Kinh. Địa hình tương đối bằng phẳng, thấp dần từ bắc xuống nam, độ cao trung bình 500m. Núi chính: Chư Đôn (826m), Chư Go (758m). Sông A Dun chảy qua. Đất lâm nghiệp chiếm 49,3% diện tích. Huyện thành lập từ 17-8-1981 thuộc tỉnh Gia Lai-Kon Tum, từ 20-7-1991 thuộc tỉnh Gia Lai, huyện gồm 1 thị trấn Chư Sê, 13 xã
- (thị trấn) h. Chư Sê, t. Gia Lai

