- (huyện) Huyện miền núi phía tây nam tỉnh Gia Lai. Diện tích 1705,2km2. Số dân 58.100 (1997), gồm các dân tộc: Giarai, êđê, Kinh, Bana v.v.. Địa hình cao nguyên, nghiêng từ đông bắc xuống tây nam, độ cao trung bình 400m bị phân cắt mạnh. Đồi núi và rừng chiếm 60,3% diện tích. Sông Ia Đrong chảy qua. Quốc lộ 14 và 19 chạy qua. Có 52km đường biên giới với Cămpuchia. Huyện thuộc tỉnh Gia Lai-Kon Tum (1976-91), từ 20-7-1991 thuộc tỉnh Gia Lai, huyện gồm 1 thị trấn Chư Prông, 13 xã
